import React from "react";
import "./Navbar.css";

const Navbar = () => {
  return (
    <nav>
      Call App
      <ul>
        <li><a href="index.html">About</a></li>
        <li><a href="index.html">Contact</a></li>
        <li><a href="index.html">Sign In</a></li>
      </ul>
    </nav>
  );
};

export default Navbar;
